import React from 'react';
import Option from './Option'

const Options = ({props}) => {
    console.log(props);
    const createOptions = (optionsAmount) => {
        let options = [];
        for (let i=0; i<optionsAmount; i++) {
            options.push("<Option id={i} />")
        }
        console.log(options);
        return options
    }
    return (

        <>
            {createOptions()}
        </>
        
        )
}

export default Options
